import { createApp } from 'vue'
import App from './App.vue'
import store from './store'

ymaps.ready(() => {
  const map = new ymaps.Map('map', {
    center: [59.938955, 30.315644],
    zoom: 10,
    controls: [],
  })
  commit('SET_MAP', {map: map, flag: true } )
  dispatch('addMarks');
})

createApp(App).use(store).mount('#app')
